  state={
    selected: 'accountMain',
  }

  selected=(value)=>{
    this.setState({
    selected: value
    })
  }

  renderSwitch(param) {
    switch(param) {
        case 'accountMain':
            return (
            <div>
                <NavBar selectedLink={this.selectedLink}/>
                <AddAccount setTerms={this.setTermsList} selectedLink={this.selectedLink}/>   
            </div>
            )
        case 'editProfile':
            return <EditProfile user={this.state.user} selectedLink={this.selectedLink}/>
        case 'accounts': 
            return <Accounts user={this.state.user} selectedLink={this.selectedLink}/>
        case 'newTicket': 
            return <NewTicket user={this.state.user} selectedLink={this.selectedLink}/>
        default: 
            return null; 
    }
}


